import { Container, Row, Col, Link } from "react-bootstrap";
import "../App.css";

function ToggleContent() {
    const [isActive, setIsActive] = useState(false);

    const handleClick = () => {
      setIsActive(!isActive);
    };

    return (
      <div onClick={handleClick}>
        <div className={isActive ? "content active" : "content"}>
          {isActive ? "Active State Content" : "Default State Content"}
        </div>
      </div>
    );
  }

export const Portfolio = () => {
    return(
        <Row id="portfolio">
            <Container id="projects d-flex flex-column">
                <div className="proj d-flex justify-content-center flex-column">
                    <div className="proj-title"><a href="https://github.com/marphco/pennywise" target="_blank" rel="noopener noreferrer">PENNYWISE</a></div>
                    <div className="proj-title">NOTEVERSE</div>
                    <div className="proj-title">ART HISTORY</div>
                    <div className="proj-title">NOTEVERSE</div>
                    <div className="proj-title">README BOT</div>
                    <div className="proj-title">FLEXI SOCIAL API</div>
                    <div className="proj-title">INFINI CART</div>
                    <div className="proj-title">EMPLOYEE SYNC</div>
                    <div className="proj-title">SCRIBELLA</div>
                    <div className="proj-title">SVG FORGE</div>
                    <div className="proj-title">SKY SWAY</div>


                </div>
            </Container>
        </Row>
    )
}

export default Portfolio;
